No it's not a supplement.
But with all the vitamins, minerals, and supplements we are told boost brain function, reduce body fat, increase testosterone, lower estrogen, and on and on and on...well, the fact of the matter is water is necessary in almost every body function. I won't bore you with the silly stats about water we have heard for years. 
Inadequate hydration can lead to lousy recovery/sleep, poor skin, exhaustion, overeating, obesity, kidney failure, digestion issues… no supplement is worth a damn if you are poorly hydrated.
How much water should you consume? Personally, I would go for 90oz or more depending on your training volume and goal. 
That's less than 3 Nalgene bottles. Don't shake your head, I know damn well we have all owned one and probably have 1 on the counter right now. 
Drink up matey's, yo-ho!

